import React from 'react';

function Cards(props)
{
  return (
    // <div>
    // <h1>RoboFriends</h1>
    <div className="tc bg-light-green dib br3 ma2 grow bw2 shadow-5">
      <img src='https://robohash.org/{props.username}?200x200' alt='robot' />
      <div>
        <h2>{props.name }</h2>
        <p> {props.email} </p>
        </div>
    </div>
    // </div>
  );
}

export default Cards;
